Suatu siang di tahun 2015, saat itu saya berkesempatan untuk mengunjungi daerah Kopeng, Jawa Tengah. Saat itu, di antara keramaian Pasar Kopeng tampak beberapa perempuan tua yang menjajakan dagangannya. Dengan berbekal sebuah bakul, para perempuan tua itu menawarkan dagangannya yang kebanyakan berupa buah-buahan, sayur mayur, serta berbagai jajanan pasar.
.
Tanda-tanda penuaan seperti kulit yang beruban dan kulit yang berkerut yang tampak jelas dari diri mereka tak serta merta mengurangi daya juangnya. Dengan semangat yang membara, mereka hadapi kerasnya dunia. Panas dan teriknya mentari tak sedikit pun mengurangi keinginan mereka untuk bekerja. Terjalnya jalanan tak jua memperlambat langkah mereka untuk menawarkan barang dagangannya pada para pembeli.
.
Saya tidak tahu persis bagaimana keadaan keluarga para perempuan tua itu. Mungkin mereka berjualan untuk memenuhi kebutuhan hidup keluarganya. Bisa jadi juga, mereka sebenarnya memiliki anak yang sukses, tapi mereka malah memilih untuk berjualan karena telah terbiasa untuk melakukan berbagai aktivitas dan pekerjaan.
.
Pertemuan dengan perempuan-perempuan tua itu menjadi cermin dan menghadirkan sebuah pertanyaan, "Apakah semangat kita dalam bekerja sama dengan semangat kerja  mereka? Atau, jangan-jangan semangat dan daya juang kita lebih lemah dari mereka, sedikit-sedikit mengeluh, kemudian menyerah karena hambatan yang datang menghadang?"
. 
Usia seharusnya tak menjadi alasan bagi seseorang kehilangan semangat untuk berjuang. Karena pada akhirnya, hidup akan menghadapkan kita pada berbagai gelombang persoalan yang harus kita taklukan. So, semangat berjuang teman-teman...! üôåüî•

